PRIUS新型プリウスZVW30系シフトノブ【ピアノブラック】 
&nbsp;&nbsp; 
センターコンソール部分のアクセントが何か物足りない・・・ インパネパネルを付けたがシフトノブが浮いてしまう・・・ そんな悩みを解消する超レアアイテム！！ 新型プリウス３０系純正交換シフトノブ【ピアノブラック】の登場です。 純正シフトノブより一回り大きくなっており、グリップ感は絶大！！ ピアノブラック×パンチングレザーのコンビタイプでラグジュアリーにもスポーティーにも演出してくれます。 
&nbsp;
&nbsp; 




仕様

■対応車種： プリウス30系 ■カラー：　ピアノブラック×パンチグレザー ■装着方法：　純正ノブを回して外し替えるだけです 

ご注意

※取付は、純正シフトノブを回して外して頂き、交換するだけです。 
※説明書等は付属いたしません。
 ※走行中に外れたりしないように確実に取付けてください。 
※少数の入荷ですので、お早めにどうぞ！ 
※プリウスαには取付できません。



&nbsp; 







　■この商品を買った人は、こんな商品にも興味をもっています。 



